//import React, { Fragment } from 'react';
//Fragment is required when multiple design components are competing for the same div


import React from 'react';
import classNames from 'classnames';
import { makeStyles } from '@material-ui/styles';
import MenuItem from '@material-ui/core/MenuItem';
import TextField from '@material-ui/core/TextField';


const useStyles = {
    FormControl: {
        width: 30
    },
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  textField: {
    marginLeft: 50,
    marginRight: 500,
    width: 200,
  },
  dense: {
    marginTop: 19,
  },
  menu: {
    width: 200,
  },
}



function TextFields() {

    //const classes = useStyles();




  return (
    <form noValidate autoComplete="off">
      <TextField
        id="standard-name"
        label="Name"
        className={useStyles.FormControl}
        value={"Yusuf"}

        margin="normal"
      />

      <TextField
        id="standard-uncontrolled"
        label="Uncontrolled"
        defaultValue="foo"

        margin="normal"
      />
      <TextField
        required
        id="standard-required"
        label="Required"
        defaultValue="Hello World"

        margin="normal"
      />
      <TextField
        error
        id="standard-error"
        label="Error"
        defaultValue="Hello World"

        margin="normal"
      />
      <TextField
        disabled
        id="standard-disabled"
        label="Disabled"
        defaultValue="Hello World"

        margin="normal"
      />



    </form>
  );
}

export default TextFields;
